import React, { Fragment, useEffect, useState } from "react";

const ListOfSplits = () => {
  const getSplits = async () => {
    try {
      const response = await fetch("http://localhost:/getSplits");
      const data = await response.json();

      console.log(data);
    } catch (err) {
      console.log(err.message);
    }
  };

  useEffect(() => {
    getSplits();
  });

  return (
    <Fragment>
      <table className="table mt-5 text-center">
        <thead>
          <tr>
            <td>Split</td>
            <td>User Id</td>
          </tr>
        </thead>
        <tbody></tbody>
      </table>
    </Fragment>
  );
};

export default ListOfSplits;
